var $j = jQuery.noConflict(); //Tumblr uses Prototype; Jquery and Prototype don't play well together.

/* Yippee! */

function buttonReply(){
	this.style.display = "none";
	
	parent = $j(this).parent();

	post = $j(this).parents("li.post");
	if($j('.reply_box_frame',post).length == 0){
		link = $j("div.post_info a",post).attr("href");
		link = link + "/"; //for some reason the URL in the post info doesn't end in a '/'. That messed up the RegEx. This is a half-assed solution.
		reg = /\/\/([\w-\.]*)\//;
		ahost = reg.exec(link);
		
		username = $j("div.post_info a",post).html();
		
		aframe = "http://tumblr.com/ask_form/" + ahost[1];
		var frame = $j('<div></div>');
		frame.attr({"class":"reply_box_frame"}).css({"margin-top":"15px","padding-top":"15px","border-top":"1px solid #e7eaec","display":"none"});
		frame.html('<a class="mesreplytitle" href="'+link+'">Reply to '+username+':</a><br/><iframe class="mesreply" src="'+aframe+'"></iframe>');
		//frame = '<div class=\"reply_box_frame\" style=\"margin-top: 15px; padding-top: 15px; border-top: 1px solid #e7eaec\"><a class="mesreplytitle" href="'+link+'">Reply to '+username+':</a><br/><iframe class="mesreply" src="'+aframe+'"></iframe></div>';
		
		$j('div.post_text_wrapper',post).append(frame);
		$j('div.post_text_wrapper',post).append('<button onclick="return false;" class="chrome cancelreply" style="margin-left: 10px; margin-top: 10px; display: none;"><div class="chrome_button"><div class="chrome_button_left"></div>Cancel Reply<div class="chrome_button_right"></div></div></button>');
		
		$j("button.cancelreply",post).click(cancelReply);
		
		frame.slideDown(500);
		$j("button.cancelreply",post).slideDown(500);
	}
	
	return false;
	
}
function cancelReply(){
	post = $j(this).parents("li.post");
	$j("div.reply_box_frame, button.cancelreply",post).slideUp(500).delay(500).remove();
}


function avatar_menu_click(){
	theURL = $j(this).attr('href');
	if(theURL.indexOf("/ask") >= 0){
		link = theURL;
		regex = /\/\/([\w-\.]*)\//;
		host = regex.exec(link);
		frame = "http://tumblr.com/ask_form/" + host[1];
		parentPost = $j(this).parents('li.post');
		username = $j('.post_info a',parentPost).html();

		TINY.box.show({html:'<a class="dashask" href="'+link+'">Ask '+username+':</a><br/><iframe class="dashask" src="'+frame+'"></iframe>',animate:true,close:true,mask:true,boxid:'dashboard_ask_box'});
		return false; 
	}
}
