function hide_question_asker(){
	var this_post = $j(this);
	$j('.asker-ask-link',this_post).fadeOut(500);
}
function answer_reply_show(){
	var this_post = $j(this);
	if($j('.askReplyButton',this_post).length == 0 && $j('.reply_box_frame',this_post).length == 0){
		link = $j("div.post_info a",this_post).attr("href");
		newLink = $j("<a></a>").attr({"href":link}).addClass("askReplyButton post_control").html("reply");
		newLink.click(buttonReply);
		newLink.css("display","none");
		$j('div.post_controls',this_post).prepend(newLink);
		$j('.askReplyButton',this_post).fadeIn(500);
	}
	else{
		if($j('.reply_box_frame',this_post).length === 0){
			$j('.askReplyButton',this_post).fadeIn(500);
		}
	}
}
function answer_reply_hide(){
	var this_post = $j(this);
	$j('.askReplyButton',this_post).fadeOut(500);
}
	



function run(){
	$j('head').append('<style type="text/css">' + "\n" + TinyboxCss + '\n' + thisCss + '\n</style>'); 
	$j('ol#posts').on('click','li .user_menu_list a',null,avatar_menu_click);
	$j('ol#posts').on({'mouseenter':question_asker_ask,'mouseleave':hide_question_asker},'li.post.note');
	$j('ol#posts').on({'mouseenter':answer_reply_show,'mouseleave':answer_reply_hide},'li.post.is_private_answer');
}

$j(document).ready(function(){
  run();
});